import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  return props.items.forEach((item) => {
    <ExpenseItem title={item.title} amount={item.amount} date={item.date} />;
  });
}

export default Expenses;
